const projects = [

  {
    title: "SmartContactManager",
    description: "A web application built with Spring Boot and Thymeleaf to manage contacts with authentication and user-friendly UI.",
    github: "https://github.com/DarshanChougule/SmartContactManager",
    demo: "#",
  },
  {
    title: "Research-Asistant-Extension",
    description: "A Java-based browser extension designed to assist researchers by streamlining the organization of references and resources.",
    github: "https://github.com/DarshanChougule/Research-Asistant-Extension",
    demo: "#",
  },
  {
    title: "ProductManager",
    description: "A Java application for managing products, demonstrating CRUD operations with clean design and code structure.",
    github: "https://github.com/DarshanChougule/ProductManager",
    demo: "#",
  },
  {
    title: "RestApiCRUD",
    description: "A Spring Boot REST API implementing full CRUD functionality for managing resources in a backend system.",
    github: "https://github.com/DarshanChougule/RestApiCRUD",
    demo: "#",
  },
  {
    title: "StudentDataHub",
    description: "A Java-based student data management system to handle student records with features like add, view, and delete.",
    github: "https://github.com/DarshanChougule/StudentDataHub",
    demo: "#",
  },
];

export default projects;
